function initCanvasSignature() {
  var divSignature = document.getElementById("cvs-signature");
  canvas = document.createElement('canvas');
  canvas.style.position = "relative";
  divSignature.appendChild(canvas);
  ctx = canvas.getContext("2d");
  ctx.canvas.width = 593.92;
  ctx.canvas.height = 170;


  document.addEventListener('mousemove', draw);
  document.addEventListener('mousedown', setPosition);
  document.addEventListener('mouseenter', setPosition);
  document.addEventListener('pointermove', (e) => {
    if (isMobile()) {
      document.dispatchEvent(new MouseEvent("mousemove", { clientX: e.clientX, clientY: e.clientY, buttons: 1 }));
    }
  }, false);
  document.addEventListener('pointerdown', (e) => {
    if (isMobile()) {
      document.dispatchEvent(new MouseEvent("mousedown", { clientX: e.clientX, clientY: e.clientY, buttons: 1 }));
    }
  });
  document.addEventListener('pointerenter', (e) => {
    if (isMobile()) {
      document.dispatchEvent(new MouseEvent('mouseenter', { clientX: e.clientX, clientY: e.clientY, buttons: 1 }));
    }
  })
}

function setPosition(e) {
  var rect = canvas.getBoundingClientRect();
  pos.x = e.clientX - rect.left;
  pos.y = e.clientY - rect.top;
}

function draw(e) {
  if (e.buttons !== 1) return;

  ctx.beginPath();

  ctx.lineWidth = 2;
  ctx.lineCap = 'round';
  ctx.strokeStyle = '#000000';
  ctx.fillStyle = '#000000';

  ctx.moveTo(pos.x, pos.y);
  setPosition(e);
  ctx.lineTo(pos.x, pos.y);
  ctx.stroke();
}

function clearSignature() {
  if (ctx) {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.beginPath();
    ctx.stroke();
  }
}

function genContractPDF() {
  window.jsPDF = window.jspdf.jsPDF;
  window.html2canvas = html2canvas;
  var doc = new jsPDF('p', 'pt', 'a4', true);
  var target = document.getElementById('main-contract');
  // target.style.border = "none";
  var canvasNode = target.getElementsByTagName("canvas")[0];
  var canvasParentNode = canvasNode.parentNode;
  var imgEl = document.createElement("img");
  imgEl.src = canvasNode.toDataURL("image/png", 1.0);

  canvasParentNode.replaceChild(imgEl, canvasNode);
  
  doc.html(target, {
    callback: function (pdf) {
      pdf.save('genContract.pdf');
    },
    x: 0,
    y: 0,
    html2canvas: { scale: 0.75 }
  })
}

